#include "HPResources.h"

@implementation HPResources
+ (UIImage *)spacerImage {
    NSURL *url = [NSURL URLWithString:@"data:image/png;base64,"];

    NSData *imageData = [NSData dataWithContentsOfURL:url];
    UIImage *ret = [UIImage imageWithData:imageData];
    return ret;
}
